import React from 'react';
import { Routes, Route } from 'react-router-dom';
import HomePage from './pages/Home'; // Update the import if needed
import FileShare from './FileShare/FileShare'; // Import the FileShare component
import Auth from './pages/loginsignup/auth'; // Your Auth page (if needed)

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/file-share" element={<FileShare />} />
        <Route path="/auth" element={<Auth />} /> {/* Optional: for authentication */}
      </Routes>
    </div>
  );
}

export default App;
